from sympy import divisors
def c(n): s = str(n); return s == "".join(sorted(set(s)))
def a(n): return sum(1 for d in divisors(n, generator=True) if c(d))
print([a(n) for n in range(1, 101)]) # _Michael S. Branicky_, Sep 16 2022

